import { Container, Grid } from "@mui/material";
import React from "react";
import Box from "@mui/material/Box";
import Story from "./Story";

function Feed() {
  return (
    <div>
      <Container maxWidth="sm">
        <Box
          sx={{
            width: 600,
            height: 350,
          }}
        >
          <Story sx={{ marginTop: "80px" }} />
        </Box>
        <box>
        <Grid  sx={{
            textAlign: "center",
            border: "1px solid black"
          }} >

            <Grid item xs={2} />
            </Grid>

        </box>
        
        
      </Container>
    
    </div>
  );
}

export default Feed;
